          ' <p><a href="https://www.flickr.com/people/pudora/">pusatdownloadarea</a> posted a photo:</p> <p><a href="https://www.flickr.com/photos/pudora/50981344001/" title="Anthurium Warocqueanum Plant Care Guide"><img src="https://live.staticflickr.com/65535/50981344001_39a814f2ce_m.jpg" width="240" height="180" alt="Anthurium Warocqueanum Plant Care Guide" /></a></p> <p>Anthurium Warocqueanum Plant Care Guide - Now I want to share how to care for this type of plant, because sometimes if we are wrong to take care of it, this beautiful plant is very easy to turn yellow at the tips of the leaves and it will spread to all parts of the leaf, for that let\'s see how to care for this Anthurium Warocqueanum plant<br /> <br /> SoilThese plants do not tend to grow in soil. The Queen is an epiphyte. Epiphytes are plants that are growing on other plants instead of in the soil. In nature, they are growing in moss and leaf litter and any debris they might come across in tree branches. A loose breathable very airy mix is therefore a must.<br /> <br /> The substrate I am using is 100% Sphagnum moss and the Anthurium warocqueanum seems to love it. A great suggestion is to provide Sphagnum Moss along the whole stem of your plant. This way the Anthurium Warocqueanum will develop roots all along the stem.<br /> <br /> There are other growers who are successfully growing it in an airy and well-draining aroid mix. Yet others are growing it in a mix between coarse bark and Sphagnum moss. Whatever medium you are using, it needs to be well-draining and hold moisture at the same time. Keep the pH level between 6.6 – 7.5 between acid and neutral.<br /> <br /> LightMedium to bright indirect light is advised. Based on my personal experience a lot of bright indirect light is best in indoor conditions. This way your Anthurium plant will grow the best.<br /> <br /> <a href="https://www.pudora.com/houseplant/anthurium-warocqueanum-plant-care-guide/" rel="noreferrer nofollow">www.pudora.com/houseplant/anthurium-warocqueanum-plant-ca...</a></p>',
